  \"biological-chemical-in-situ-navigational-physical-and-profile-data-collected-by-commonwealth-sc\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Biological, chemical, in situ, navigational,
  physical and profile oceanographic data were collected, including CHLOROPHYLL, CONDUCTIVITY,
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, LATITUDE, LONGITUDE, NITRATE, PHOTOSYNTHETIC
  ACTIVE RADIATION (PAR), SALINITY, WATER DENSITY, WATER TEMPERATURE, WAVE HEIGHT
  - SIGNIFICANT and turbidity from Moored Buoy at the Southern Ocean Time Series (SOTS)
  using pressure sensors from 2011-08-03 to 2013-10-13. These data were provided to
  one of the OceanSITES Data Assembly Centers (DAC). The DAC formatted this information
  into the OceanSITES file format and passed it on to the Global Data Assembly Centers
  (GDAC).nnOceanSITES is a worldwide system of long-term, open-ocean reference stations
  measuring dozens of variables and monitoring the full depth of the ocean from air-sea
  interactions down to the seafloor. It is a network of stations or observatories
  measuring many aspects of the ocean's surface and water column using, where possible,
  automated systems with advanced sensors and telecommunications systems, yielding
  high time resolution, often in real-time, while building a long record.\",\n\t\"license_title\":
